import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

function createcard(notess){
  return <Note
key = {notes.id}
title = {notes.title}
content = {notes.content} 
  />
}

function App() {
  return (
    <div>
      <Header />


      <Footer />

    </div>


);
}

export default App;
